export default function ListNumber() {



    const [counts, setCounts] = useState([]);
    useEffect(() => {
        getCounts();
    }, []);

    //var ip = window.location.host;

    /*function getCounts() {
        axios.get('http://'+ip+'/counter-app/api/').then(function(response) {
            console.log(response.data);
            setCounts(response.data);
        });
        setTimeout(() => getCounts(), 2000);
    }*/

    function getCounts() {
        axios.get('http://localhost:8080/counter-app/api/').then(function(response) {
            console.log(response.data);
            setCounts(response.data);
        });
        setTimeout(() => getCounts(), 2000);
    }



    return (


        <div class ="container">

            <div class="item">
                <h1></h1>
                <img src={`http://localhost:8080/counter-app/logo.png`} alt="logo"/>
                <h1>Current active number is:</h1>
                <h4>{counts.current_number}</h4>
            </div>
        </div>


    )
}
